import {React,  useEffect, useState } from "react";
import { useLocation, useParams,useNavigate, Navigate, createSearchParams } from "react-router-dom";
import axios from 'axios';
import Header from "../layouts/Header";



function DentistForm()
{
  
  
  
  const navigate = useNavigate();
  

  const [dentist, setDentist] = useState({
      name: "",
      surname: "",
      username: "",
      password: "",
      email: "",
      
    });

    

    function handleChange(event)
    {
        const { name, value } = event.target;

        setDentist(prevValue => {
            return {
              ...prevValue,
              [name]: value
            };
          });
    }
    
    const handleSubmit = async(event) =>
    {
      
      event.preventDefault();
      console.log("line 37 Login")
      try{
        
        const response = await axios.post(`http://localhost:8080/createDentist`,
        
        JSON.stringify(dentist),
          {
            headers: {"Content-Type": "application/json"},
            withCredentials:false
          }
        );
        const queryParams = {submittedName:dentist.name, submittedSurname:dentist.surname, result: ""};
        if(response.status===201)
        {
          queryParams.result = "true";
          console.log("Succesful submit");
          
          
        }else{
          queryParams.result = "fail";
          console.log("Unsuccesful submit");
        }
        navigate({pathname: `/dentistpage/${dentist.dentistId}/patientForm/resultForm`, search: `?${createSearchParams(queryParams)}`});
      }catch(err){
        console.log(err);
        
      };
      
      
    }



   
    return (
      <div>
        <Header title={"ToothHub"}/>
        <div style={{width:"30%", height:"100%", marginTop:"2%"}}>
          <h2 style={{textAlign:"left", paddingLeft:"10px", color:"white"}}>New Dentist Form</h2>

          <form onSubmit={handleSubmit}>

            <label for="fname" style={{color:"white"}}>First name:</label><br/>
            <input type="text"  name="name" onChange= {handleChange} value={dentist.name} style={{float:"left", paddingLeft:"15px"}}/>
            <br/>   
            <br/>
            <br/>
            <label for="lname" style={{color:"white"}}>Last name:</label><br/>
            <input type="text"  name="surname" onChange= {handleChange} value={dentist.surname} style={{float:"left", paddingLeft:"15px"}}/>
            <br/>   
            <br/>
            <br/>
            <label for="username" style={{color:"white"}}>Username:</label><br/>
            <input type="text"  name="username" onChange= {handleChange} value={dentist.username} style={{float:"left", paddingLeft:"15px"}}/>
            <br/>   
            <br/>
            <br/>
            <label for="password" style={{color:"white"}}>Password:</label><br/>
            <input type="password"  name="password" onChange= {handleChange} value={dentist.password} style={{float:"left", paddingLeft:"15px"}}/>
            <br/>   
            <br/>
            <br/>
            <label for="email" style={{color:"white"}}>Email:</label><br/>
            <input type="text"  name="email" onChange= {handleChange} value={dentist.email} style={{float:"left", paddingLeft:"15px"}}/>
            <br/>   
            <br/>
            <br/>
            


            <button >Save</button>

          </form>

      </div>
    </div>);




}

export default DentistForm;
